import React from 'react';
import Typewriter from 'typewriter-effect';

export class Test extends React.Component {
    render() {
        return(
            <div className='mt-64'>
                <Typewriter
                    options= {{
                        strings: ["Welcome", "Bienvenido", "Salut", "Privet", "Yōkoso"],
                        autoStart: true,
                        loop: true,
                        cursor: "_"
                    }}
                />
            </div>
        );
    }
}
